import React from "react";
import squintz from '../images/squints.png'


export default function TeamCard({users}) {

    if (!users.length) {
        return <h1>Loading...</h1>
    }

  return (
    <ul className="list-group mt-2" data-bs-theme="dark">
      {users.map((user) => {
        return (
          <div key={user.id}>
            <li className="list-group-item rounded">
              <img src={user.image ? `../client/src/${user.image}` : ""} className="teamImg"></img>
              {user.username}
            </li>
          </div>
        );
      })}
    </ul>
  );
}
